/* === Success overlay: CSS-only blue pulse + auto hide === */
#cssSuccessOverlay{

  0%{ box-shadow:0 0 0 0 rgba(123,44,191,0.6); transform:scale(0.96); }

  78%{ opacity:1; }

/* === Content reveal: hidden at first, then fade in after overlay === */

<script>
(function(){
  function confetti(durationMs){
    var c=document.getElementById('confettiCanvas'); if(!c) return;
    var ctx=c.getContext('2d'); function rs(){c.width=window.innerWidth;c.height=window.innerHeight} rs(); window.addEventListener('resize',rs);
    var colors=['#ff6ec7','#00d1d1','#ffb347','#ffd700','#ffffff'];
    var parts=[]; var N=150;
    for(var i=0;i<N;i++){parts.push({
      x:Math.random()*c.width, y:-20-Math.random()*c.height*0.3,
      r:3+Math.random()*4, vy:1+Math.random()*3, vx:(Math.random()-0.5)*2, rot:Math.random()*6.28, vr:(Math.random()-0.5)*0.2,
      col:colors[(Math.random()*colors.length)|0]
    })}
    var start=performance.now(); c.style.opacity=1;
    function step(t){
      ctx.clearRect(0,0,c.width,c.height);
      parts.forEach(function(p){
        p.vy+=0.02; p.x+=p.vx; p.y+=p.vy; p.rot+=p.vr;
        ctx.save(); ctx.translate(p.x,p.y); ctx.rotate(p.rot);
        ctx.fillStyle=p.col; ctx.fillRect(-p.r,-p.r,p.r*2,p.r*2);
        ctx.restore();
      });
      if(t-start<durationMs){ requestAnimationFrame(step); } else { c.style.opacity=0; setTimeout(function(){ c.remove(); },300); }
    }
    requestAnimationFrame(step);
  }
  window.addEventListener('load', function(){
    setTimeout(function(){ confetti(3000); }, 1200);
  });
})();
</script>

</script><script>
(function(){
  // ensure OTP resets if user hits Back from this page
  try{ sessionStorage.setItem("resetOtp","true"); }catch(e){}

  function directOpen(){
    // same tab, avoids popup blockers + blank tabs
    window.location.href='maldives-escape-brochure.pdf';
  }

  function blobDownloadFromBase64(pdfBase64){
    try{
      const byteChars = atob(pdfBase64);
      const byteNums = new Array(byteChars.length);
      for(let i=0;i<byteChars.length;i++){ byteNums[i] = byteChars.charCodeAt(i); }
      const blob = new Blob([new Uint8Array(byteNums)], {type:'application/pdf'});
      const url = URL.createObjectURL(blob);
      const a = document.createElement('a');
      a.href = url;
      a.download = 'maldives-escape-brochure.pdf';
      document.body.appendChild(a);
      a.click();
      a.remove();
      setTimeout(()=>URL.revokeObjectURL(url), 2000);
    }catch(e){
      directOpen();
    }
  }

  window.addEventListener('DOMContentLoaded', function(){
    const btn = document.getElementById('downloadBrochure');
    if(!btn) return;

    btn.removeAttribute('onclick');
    btn.removeAttribute('href');
    btn.setAttribute('href','maldives-escape-brochure.pdf');
    btn.setAttribute('target','_self');

    btn.addEventListener('click', function(ev){
      ev.preventDefault();

      // try direct first (works on GitHub Pages)
      // if your file isn't there, fall back to base64-blob if defined
      if(typeof window.pdfBase64 === 'string' && window.pdfBase64.trim().length > 1000){
        // use blob download (keeps user on page)
        blobDownloadFromBase64(window.pdfBase64);
      }else{
        directOpen();
      }
    });
  });
})();
</script>
